import React from 'react';
import "./App.scss";

function Morpheme(props) {
    return(
        <div>
            <h3>{props.sounds}</h3>
            <p>{props.type}</p>
            <p>{props.meaning}</p>
        </div>
    )
}
export default Morpheme
